job_summary:
It's a contracting position for a period of 6-12 months.
Manage IFRS 15 accounting elements and revenue recognition;
Liaising with the external auditor;

Je komt te werken op de controlepraktijk van een accountantskantoor.
Het kantoor bestaat uit ruim 50 medewerkers.
Hbo Accountancy behaald of master;

He/she reports directly to the CEO and Supervisory Board.
Growth agenda including M&A processes, integration and financing;
M&G’s focus for the coming years:

Het verzorgen van diverse fiscale aangiften (ib, Vpb en erf);
Het voorbereiden van fiscale adviezen;
Dit accountantskantoor ligt in de Zaanstreek en in totaal…

The Group wide business performance and budget cycle;
The consolidation, external reporting and statutory accounts of the Group;
Between 6-8 years’ experience;
